import React from "react";

const Hello = props => {
  return (
    <div>
      <p>
        Hello {props.name}, you are {props.age} years old
      </p>
    </div>
  );
};

const App = () => {
  const name = "Carson";
  const age = 25;
  return (
    <div>
      <h1>Greeting</h1>
      <Hello name="Carson" />
      <Hello name="Megan" />
      <Hello name="Jude" />
    </div>
  );
};

export default App;
